<h2>SSCAIT 2017/18</h2>
<div>
   The 2017/17 installment of SSCAIT sported 78 participants. The tournament was divided into two divisions:
   <ul>
      <li><b>Student division</b>: Round Robin tournament of 6006 games, where everybody played two games against everybody else. 
         Only the individual student authors were eligible for the title.
      <li><b>Mixed division</b>: Double elimination bracket of 16 best bots (including non-students and teams).
   </ul>
